import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import { Container, Row, Col } from 'reactstrap';
import "./skills.css";



const Progress = ({done}) => {
	const [style, setStyle] = React.useState({});

	setTimeout(() => {
		const newStyle = {
            fontSize:"12px",
			opacity: 1,
            width: `${done}%`,

		}

		setStyle(newStyle);
	}, 200);

	return (
		<div className="progress">
			<div className="progress-done" style={style}>
				{done}%
			</div>
		</div>
	)
}



const Skills = () => {

const classes = useStyles();

    return (

        <Container className={classes.background}>
                <Row className={classes.skillTitle}><h2>My Skills</h2></Row>
           <Row class={classes.AllTextCenter}>

                <Row className={classes.flexAligh}>
                    <Col className={classes.skillItems}>   
                      <div className={classes.filledBarOnLine}>
                         <h3 className={classes.h3}>HTML5 / CSS3</h3>
                         <Progress done="90"/>
                      </div>              
                    </Col>
                    <Col className={classes.skillItems}>
                    <div className={classes.filledBarOnLine}>
                        <h3 className={classes.h3strap}>Bootstrap</h3>
                        <Progress done="80"/>
                      </div>
                    </Col>
                </Row>  
                <Row className={classes.flexAligh}>
                    <Col className={classes.skillItems}>   
                      <div className={classes.filledBarOnLine}>
                         <h3 className={classes.h3}>JavaScript</h3>
                        <Progress done="85"/>
                      </div>              
                    </Col>
                    <Col className={classes.skillItems}>
                    <div className={classes.filledBarOnLine}>
                      <h3 className={classes.h3strap}>ReactJS</h3>
                      <Progress done="75"/>
                      </div>
                    </Col>
                </Row> 
                <Row className={classes.flexAligh}>
                    <Col className={classes.skillItems}>   
                      <div className={classes.filledBarOnLine}>
                         <h3 className={classes.h3}>React Native</h3>
                        <Progress done="65"/>
                      </div>              
                    </Col>
                    <Col className={classes.skillItems}>
                    <div className={classes.filledBarOnLine}>
                      <h3 className={classes.h3strap}>NodeJS</h3>
                      <Progress done="60"/>
                      </div>
                    </Col>
                </Row> 
                <Row className={classes.flexAligh}>
                    <Col className={classes.skillItems}>   
                      <div className={classes.filledBarOnLine}>
                         <h3 className={classes.h3}>Git</h3>
                        <Progress done="95"/>
                      </div>              
                    </Col>
                    <Col className={classes.skillItems}>
                    <div className={classes.filledBarOnLine}>
                      <h3 className={classes.h3strap}>Firebase</h3>
                      <Progress done="85"/>
                      </div>
                    </Col>
                </Row> 


           </Row>   
        </Container>                        

    );
  };
  export default Skills;


  const useStyles = makeStyles((theme) => ({
    skillTitle: {

      fontSize:"26px",
      padding:"2rem",
      textAlign:"center",
      color:"white",
    },
    background:{
        height:"100vh",
        backgroundColor:"#233",
    },
    AllTextCenter:{
        textAlign:"center",

    },
    flexAligh:{
        margin:"0.5rem",
        alignItem:"center",
        color:"white",
        display:"flex",
        flexDirection:"row",
    },
    filledBarOnLine:{
        display:"flex",
        flexDirection:"row",
        justifyContent:"center",
    },
    h3:{
        marginLeft:"5rem",
        marginRight:"2rem",
    },
    h3strap:{
        marginLeft:"2rem",
        marginRight:"2rem",

    }


  }));
